import MyNavbar from "./components/Navbar/Navbar";
import { Navigate} from "react-router-dom";
function Setting(){
    const isLogin=(username)=>{
        if(username=='admin')return true
        return false
      }
      return (
        <>
        {isLogin('mm')?(
        <div>
           <MyNavbar />
          <h1>Panel page</h1>
        </div>
       
        ):
        (
          <Navigate to={'/'}/>
        )}
        </>
      )
}
export default Setting
